import React from 'react';
import logo from './logo.svg';
import './Main.css';

import {
  Switch,
  Route,
} from 'react-router-dom';

const pages = [
  {id: 1, title: 'Lorem', path: '/'},
  {id: 2, title: 'Ipsum', path: '/ipsum'},
  {id: 3, title: 'Dolor', path: '/dolor'},
  {id: 4, title: 'Sit Amet', path: '/sit-amet'}
]

function Main() {
  const page = pages.map((page) =>
    <Route path={page.path} >
      {page.title}
    </Route>
  );

  return (
    <main className="Main">
      <Switch>
	{page}
      </Switch>
    </main>
  );
}
